import React from 'react';
import './LikeButton.scss';
import imageLike from '../../Asset/Images/bitmap@3x.png';
import imageDisLike from '../../Asset/Images/bitmap@3x.png';
function LikeButton({isLike}) {
  return (
    <div className={isLike ? 'like-button' : 'dislike-button'} style={{background:'black'}}>
      <img src={isLike ? imageLike : imageDisLike} alt="" />
    </div>
  );
}

export default LikeButton;
